collections.description:
Cosmodesias imagines a region not subjected to orthodox physical space-time conventions. Light trails navigate a multi-dimensional space warped and bent by mathematical formulas, producing imaginary volumes which become a humble reminder of the vast unknown surrounding us and our existence.

High res print version available for collectors at: 
https://proper-code.com/cosmodesias#{token_id}

Dance of the primitive shapes - demonstrating my fascination and love of the basic building blocks for many types of computer generated imagery. 
Incorporating random chance with some strict design decisions, numerous sub variations and collectable series can be generated. 
Controls: mouse to rotate and zoom in/out; r: reset position; p: play/pause; t: trails on/off;
